window.bookSummaryJSON = "<p><b>Once upon a time, there was a half-witch of three who walked on the land where creatures roamed free.</b></p> <p>Once upon a time, there was a prince of one who danced with the waves under the sun.</p> <p>Once upon a time, there was a prince of two who hid amongst the shadows, where fear only grew.</p> <p>But when time became impatient, a prophecy was conceived of twins born of darkness who would live their lives aggrieved.</p> <p>Coupled with their misery was the answer all sought. But the question remained: which one would be left to rot?</p>"; 
